//     console.log(country.name);
//     return country;
//   });
  //   if (!country) {
  //     return <div>Country not found</div>;
  //     }

    return (<>
        {countries && (
            <div>
                {countries.map((country) => (
                    <div key={country.cca2} className="card">
                        <h2>Country details</h2>
                        <p>{country.name.common }</p>
                     </div>
                ))}
 </div>
        ) }
    </>)
}
export default Detailspage;
